import React from 'react'
import ToDo from './ToDo'


function ToDos(props) {
  return (
    <div className='container'>
      <h3 className='text-center my-3'>
        To Do List
      </h3>
      {props.todos.map((todo)=>{

        return <ToDo todo={props.todo}/>

      })}
      

    </div>
  )
}

export default ToDos
